function(){
var pieceIds = game.getNode(game.getActivePlayerId()).getCollectionPaths('owner'),
i,
coordinate,
coordinates = [];

for(i=0;i<pieceIds.length;i+=1){
coordinate = game.getCoordinateOfPiece(pieceIds[i]);
if(coordinates.indexOf(coordinate) === -1){
coordinates.push(coordinate);
}
}

return coordinates;
}

function(){
var playerIds = game.getPlayerIds(),
coordinateMap = {},
i;

for(i=0;i<playerIds.length;i+=1){
switch(game.getNode(playerIds[i]).getAttribute('name')){
case 'Player1':
coordinateMap[playerIds[i]] = {base:0,start:5,end:55,extra:57};
break;
case 'Player2':
coordinateMap[playerIds[i]] = {base:1,start:18,end:16,extra:62};
break;
case 'Player3':
coordinateMap[playerIds[i]] = {base:2,start:31,end:29,extra:67};
break;
case 'Player4':
coordinateMap[playerIds[i]] = {base:3,start:44,end:42,extra:72};
break;
}
}
return coordinateMap;
}

function(){
var coordinates = getCoordinatesOfPieces();
if(coordinates.length === 1 && coordinates[0] === 4){
return true;
}
return false;
}

function(pieceId){
var info = getOwnCoordinates(),
start = game.getCoordinateOfPiece(pieceId),
dice = game.getDiceValue(),
end,
params={};

params[pieceId] = {};

if(start === info.base){
end = info.start;
} else if(start>=info.extra){
if(start+dice>info.extra+4){
end = 4;
} else {
end = start+dice;
}
} else {
if(start+dice > info.end && start < info.end){
end = start+dice - info.end - 1;
if(end > 4){
end = 4;
} else {
end +=info.extra;
}
} else if(start+dice > 56){
end = start+dice - 56 + 5;
} else {
end = start+dice;
} 
}

params.parentId = game.getTileIdOfCoordinate(end);
if(end !== 4){
sendPiecesBackToBase(end);
}
game.moveMoreNodes(params);
if(everyOneIsHome()){
game.endGame(game.getActivePlayerId());
}
game.endTurn();
}

function(){
var coordinates = getOwnCoordinates(),
pieceCoordinates = getCoordinatesOfPieces(),
diceValue,
highlighted = false,
i;
game.roll();
diceValue = game.getDiceValue();

for(i=0;i<pieceCoordinates.length;i+=1){
if((pieceCoordinates[i] === coordinates.base && diceValue === 6) ||
(pieceCoordinates[i]>=5 && pieceCoordinates[i]<=56) ||
pieceCoordinates[i]>=coordinates.extra){
highlightCoordinate(pieceCoordinates[i]);
highlighted = true;
} 
}

if(!highlighted){
game.endTurn();
return;
}
}

function(pieceId){
var coordinate = game.getCoordinateOfPiece(pieceId),
selectedId = game.getSelectedItem(),
highlightedIds = game.getHighlightedItems(),
i;
if(selectedId && game.getNode(selectedId).getAttribute('coordinate') === coordinate){
return true;
}

for(i=0;i<highlightedIds.length;i+=1){
if(game.getNode(highlightedIds[i]).getAttribute('coordinate') === coordinate){
return true;
}
}

return false;
}

function(coordinate){
var pieceIds = game.getAllPieceIdsOnTile(game.getTileIdOfCoordinate(coordinate)),
info = getCoordinateMap(),
params,
i;
for(i=0;i<pieceIds.length;i+=1){
if(game.getActivePlayerId() !== game.getPointerTarget(pieceIds[i],'owner')){
params = {};
params[pieceIds[i]]={};
params.parentId = game.getTileIdOfCoordinate(info[game.getPointerTarget(pieceIds[i],'owner')].base);
game.moveMoreNodes(params);
}
}
}
